import React, {Component, useEffect, useState} from "react";
import {useParams} from "react-router-dom";
import {getAuctionDetail} from "../../services/EnchereService";
import Brand from "../Brand";
import Footer from "../Footer";
import OffreEnchere from "./OffreEnchere";

export default function DetailEnchere(){
    const params = useParams();
    const [load, isLoad] = useState(false);
    const [data, setDate] = useState(null);
    const [component, setComponent] = useState();

    useEffect(()=>{
        getAuctionDetail(params.id).then(res=>{
            setDate(res.data);
            console.log(res.data)
            isLoad(true)
            description()
        })
    }, [])

    function description(){
        setComponent(()=>{
            if (data){
                console.log(data)
                return(
                    <div className="tab-content" id="pills-tabContent">
                        <div className="tab-pane fade show active wow fadeInUp" data-wow-duration="1.5s"
                             data-wow-delay=".2s" id="pills-home" role="tabpanel"
                             aria-labelledby="pills-home-tab">
                            <div className="describe-content">
                                {/*<h4>How can have anything you ant in life if you ?</h4>*/}
                                <p className="para">
                                    {data.description}
                                </p>
                            </div>
                        </div>
                    </div>
                )
            }
        })
    }

    function offre(){
        setComponent(()=>{
            return(
                <OffreEnchere></OffreEnchere>
            )
        })
    }

    if (!data){
        return (
            <div className="preloader">
                <div className="loader">
                    <span></span>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        )
    }
    return(
        <>
            <Brand></Brand>
            <div className="auction-details-section pt-120">
                <img alt="image" src={require("../../assets/images/bg/section-bg.png")} className="img-fluid section-bg-top" />
                <img alt="image" src={require("../../assets/images/bg/section-bg.png")} className="img-fluid section-bg-bottom" />
                <div className="container">
                    <div className="row g-4 mb-50">
                        <div
                            className="col-xl-6 col-lg-7">
                            <ul className="nav nav-pills d-flex flex-row justify-content-start gap-sm-4 gap-3 mb-45 wow fadeInDown"
                                data-wow-duration="1.5s" data-wow-delay=".2s" id="pills-tab" role="tablist">
                                <li className="nav-item" role="presentation">
                                    <button className="nav-link active details-tab-btn" type="button" onClick={description}>
                                        Description
                                    </button>
                                </li>
                                <li className="nav-item" role="presentation">
                                    <button className="nav-link details-tab-btn" onClick={offre}  type="button">Offre
                                    </button>
                                </li>
                            </ul>
                            {component}
                        </div>
                        <div className="col-xl-6 col-lg-5">
                            <div className="product-details-right  wow fadeInDown" data-wow-duration="1.5s"
                                 data-wow-delay=".2s">
                                {/*<h3>Creative Fashion Riboon Digital Watch Little Elegant.</h3>*/}
                                <h3>{data.produit}</h3>
                                <p className="para">Korem ipsum dolor amet, consectetur adipiscing elit. Maece nas
                                    in pulvinar neque. Nulla finibus lobortis pulvinar. Donec a consectetur
                                    nulla.</p>
                                <h4>Bidding Price: <span>Ar {data.prixMin}</span></h4>
                                <div className="bid-form">
                                    <div className="form-title">
                                        <h5>Bid Now</h5>
                                        <p>Bid Amount : Minimum Bid $20.00</p>
                                    </div>
                                    <form>
                                        <div className="form-inner gap-2">
                                            <input type="text" placeholder="$00.00" />
                                            <button className="eg-btn btn--primary btn--sm" type="submit">Place
                                                Bid
                                            </button>
                                        </div>
                                    </form>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row d-flex justify-content-center g-4">

                    </div>
                </div>
            </div>
            <Footer></Footer>
        </>
    )
}
